import {Link} from 'react-router-dom'
let Nav = () =>{
    return(
        <nav>
            <Link to = '/'>Home</Link>
            <Link to = '/result'>Results</Link>
            <Link to = '/add-results'>Store-Results</Link>
        </nav>
    )
}
export default N
